import InputClient from './InputClient';
import CreateMenu from './CreateMenu';

class ShowMenu extends Component {


    render() {
      return (
        <div className="ShowMenu">
          <InputClient />  
          <h6>Pedido de '{this.state.name}'</h6>   
          <CreateMenu />
        </div>
      )
    }
  }

  export default ShowMenu;
